    # print(train_set)
    suma=0
    suma_odziv=0
    for user in test_set:
        relevant = []
        retrieved = []
        temp = test_set[user].items()
        temp_sorted = sorted(temp, key=lambda x: x[1], reverse=True)
        for el in temp_sorted[:10]:
            relevant.append(el[0])
        # print(relevant)
        for i in relevant:
            test_set[user].pop(i)
        train_set[user] = test_set[user]
        prep_user = get_recommendations(train_set, user)
        train_set.pop(user)
        for el in prep_user[:10]:
            retrieved.append(el[1])
        relevant = set(relevant)
        retrieved = set(retrieved)
        if len(retrieved) == 0:
            preciznost = 0.0
        else:
            preciznost = relevant.intersection(retrieved).__len__() / retrieved.__len__()
        odziv=relevant.intersection(retrieved).__len__()/relevant.__len__()
        suma+=preciznost
        suma_odziv+=odziv
    print(f"Preciznost: {suma/len(test_set)}")
    print(f"Odziv: {suma_odziv/len(test_set)}")
